import React from 'react'
import { ListGroup, ListGroupItem } from 'reactstrap'

function Menu(){
    return (
      <ListGroup>
        <ListGroupItem tag="a" href="#!">
          Home
        </ListGroupItem>
        <ListGroupItem>Add Course</ListGroupItem>
        <ListGroupItem>View Courses</ListGroupItem>
      </ListGroup>
    );
}

export default Menu
